import react from 'react'
import books from '../assets/data'

const BooksList = () => {
    return(
        <div>
            <div className='books-list'>
                {books.map(book => (
                    <div>
                    <h3>{book.title}</h3>
                    <h5>{book.id} : {book.isbn}</h5>
                    <h5>{book.author.firstname} {book.author.lastname}</h5>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default BooksList;
